import { Switch } from '@mui/material';
import { BrowserRouter, Route } from 'react-router-dom';
import './App.css';
import Header from './components/Header/Header';

function App() {
  return (
    <BrowserRouter>
      <div className = "app" >

        <Header />

        <Switch>
          <Route path = '/' exact>
            <Home  />

          </Route>
        </Switch>

      </div>
    </BrowserRouter>
  );
}

export default App;
